function calculate(inputs) {
    return NeuralNet.reduce(function(input, layer) {
        return layer.map(function(neuron) {
            var bias, weights
            [bias, weights] = neuron;

            var sum = 0
            for(var i = 0; i < input.length; ++i) {
                sum += input[i] * weights[i];
            }
            sum += bias

            return 1.0 / (1.0 + Math.exp(-sum));
        });
    }, inputs);
}

